INSERT INTO `b_iblock_element` VALUES (1,'2018-07-21 16:22:20',1,'2018-07-21 16:22:20',1,1,NULL,'Y',NULL,NULL,500,'Форум производителей одежды в России',2,'С 20 по 23 февраля состоится <strong>Форум производителей одежды в России</strong> &ndash; важнейшее мероприятии отрасли в этом году.','html',3,'<p>С 20 по 23 февраля этого года состоится <strong>Форум производителей одежды в России</strong> &ndash; важнейшее мероприятии отрасли в текущем году. В экспозиции принимают участие свыше 160 компаний из <em>Беларуси, Австрии, Латвии, Литвы, России, Польши </em>и<em> Украины</em>. В составе форума состоится пять выставок:&quot;Московский Фэшн Салон&quot;, &quot;Технологии в Одежде&quot;, &quot;Офис Комфорт&quot;, &quot;Повседневная одежда&quot; и &quot;Детская одежда&quot;. Экспозиция будет строиться по принципу двух тематических секторов:<em> одежда</em> и <em>материалы для ее производства</em>.\r\n					<br />\r\n					</p>\r\n\r\n					<p>В секторе готовой одежды будут представлены:</p>\r\n\r\n					<ul>\r\n					<li>одежда для дома;</li>\r\n\r\n					<li>одежда для детей и молодежи;</li>\r\n\r\n					<li>аксессуары в одежде;</li>\r\n\r\n					<li>одежда для спорта и отдыха;</li>\r\n\r\n					<li>одежда для офиса.</li>\r\n					</ul>\r\n\r\n					<p>В секторе материалов для производства одежды будут демонстрироваться новинки рынка одежной фурнитуры, материалов, тканей, элементов и аксессуаров для производства одежды.\r\n					<br />\r\n					</p>\r\n\r\n					<p>Помимо расширенной экспозиции пяти тематических выставок &quot;Экспофорум&quot; подготовил разнообразную деловую программу форума производителей Одежды. В рамках выставки состоятся семинары и мастер-классы. И поистине масштабным в этом году обещает стать республиканский конкурс форума &quot;<strong>Народное признание</strong>&quot;. В этом году он выходит за рамки выставки и становится республиканским смотром образцов одежды.   </p>\r\n\r\n					<p><strong>Форум производителей Одежды</strong> предоставляет специалистам возможность познакомиться с тенденциями моды, провести переговоры, получить практические предложения рынка, увидеть перспективы развития и новые конкурентные преимущества. Впервые для участников конкурса будет подготовлен маркетинговый отчет по результатам опроса посетителей выставок <strong>Форума производителей Одежды</strong>.\r\n					<br />\r\n					</p>\r\n\r\n					<p><em>Прием заявок на участие в конкурсе осуществляется до 12 января этого года.</em></p>\r\n\r\n					<ul> </ul>\r\n ','html','ФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ\r\nС 20 ПО 23 ФЕВРАЛЯ СОСТОИТСЯ ФОРУМ ПРОИЗВОДИТЕЛЕЙ \r\nОДЕЖДЫ В РОССИИ &NDASH; ВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ЭТОМ ГОДУ.\r\nС 20 ПО 23 ФЕВРАЛЯ ЭТОГО ГОДА СОСТОИТСЯ ФОРУМ \r\nПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ &NDASH; ВАЖНЕЙШЕЕ МЕРОПРИЯТИИ ОТРАСЛИ В ТЕКУЩЕМ ГОДУ. В ЭКСПОЗИЦИИ ПРИНИМАЮТ УЧАСТИЕ СВЫШЕ 160 КОМПАНИЙ ИЗ БЕЛАРУСИ, АВСТРИИ, ЛАТВИИ, ЛИТВЫ, РОССИИ, ПОЛЬШИ И УКРАИНЫ. В СОСТАВЕ ФОРУМА СОСТОИТСЯ ПЯТЬ ВЫСТАВОК:\"МОСКОВСКИЙ ФЭШН САЛОН\", \"ТЕХНОЛОГИИ В ОДЕЖДЕ\", \"ОФИС КОМФОРТ\", \"ПОВСЕДНЕВНАЯ ОДЕЖДА\" И \"ДЕТСКАЯ ОДЕЖДА\". ЭКСПОЗИЦИЯ БУДЕТ СТРОИТЬСЯ ПО ПРИНЦИПУ ДВУХ ТЕМАТИЧЕСКИХ СЕКТОРОВ: ОДЕЖДА И МАТЕРИАЛЫ ДЛЯ ЕЕ ПРОИЗВОДСТВА. \r\n \r\n\r\nВ СЕКТОРЕ ГОТОВОЙ ОДЕЖДЫ БУДУТ ПРЕДСТАВЛЕНЫ: \r\n\r\n- ОДЕЖДА ДЛЯ ДОМА; \r\n- ОДЕЖДА ДЛЯ ДЕТЕЙ И МОЛОДЕЖИ; \r\n- АКСЕССУАРЫ В ОДЕЖДЕ; \r\n- ОДЕЖДА ДЛЯ СПОРТА И ОТДЫХА; \r\n- ОДЕЖДА ДЛЯ ОФИСА. \r\n\r\nВ СЕКТОРЕ МАТЕРИАЛОВ ДЛЯ ПРОИЗВОДСТВА \r\nОДЕЖДЫ БУДУТ ДЕМОНСТРИРОВАТЬСЯ НОВИНКИ РЫНКА ОДЕЖНОЙ ФУРНИТУРЫ, МАТЕРИАЛОВ, ТКАНЕЙ, ЭЛЕМЕНТОВ И АКСЕССУАРОВ ДЛЯ ПРОИЗВОДСТВА ОДЕЖДЫ. \r\n \r\n\r\nПОМИМО РАСШИРЕННОЙ ЭКСПОЗИЦИИ ПЯТИ ТЕМАТИЧЕСКИХ \r\nВЫСТАВОК \"ЭКСПОФОРУМ\" ПОДГОТОВИЛ РАЗНООБРАЗНУЮ ДЕЛОВУЮ ПРОГРАММУ ФОРУМА ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ. В РАМКАХ ВЫСТАВКИ СОСТОЯТСЯ СЕМИНАРЫ И МАСТЕР-КЛАССЫ. И ПОИСТИНЕ МАСШТАБНЫМ В ЭТОМ ГОДУ ОБЕЩАЕТ СТАТЬ РЕСПУБЛИКАНСКИЙ КОНКУРС ФОРУМА \"НАРОДНОЕ ПРИЗНАНИЕ\". В ЭТОМ ГОДУ ОН ВЫХОДИТ ЗА РАМКИ ВЫСТАВКИ И СТАНОВИТСЯ РЕСПУБЛИКАНСКИМ СМОТРОМ ОБРАЗЦОВ ОДЕЖДЫ.    \r\n\r\nФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ ПРЕДОСТАВЛЯЕТ \r\nСПЕЦИАЛИСТАМ ВОЗМОЖНОСТЬ ПОЗНАКОМИТЬСЯ С ТЕНДЕНЦИЯМИ МОДЫ, ПРОВЕСТИ ПЕРЕГОВОРЫ, ПОЛУЧИТЬ ПРАКТИЧЕСКИЕ ПРЕДЛОЖЕНИЯ РЫНКА, УВИДЕТЬ ПЕРСПЕКТИВЫ РАЗВИТИЯ И НОВЫЕ КОНКУРЕНТНЫЕ ПРЕИМУЩЕСТВА. ВПЕРВЫЕ ДЛЯ УЧАСТНИКОВ КОНКУРСА БУДЕТ ПОДГОТОВЛЕН МАРКЕТИНГОВЫЙ ОТЧЕТ ПО РЕЗУЛЬТАТАМ ОПРОСА ПОСЕТИТЕЛЕЙ ВЫСТАВОК ФОРУМА ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ. \r\n \r\n\r\nПРИЕМ ЗАЯВОК НА УЧАСТИЕ В КОНКУРСЕ ОСУЩЕСТВЛЯЕТСЯ \r\nДО 12 ЯНВАРЯ ЭТОГО ГОДА.',1,NULL,NULL,NULL,NULL,NULL,'N','1','forum_of_producers_of_clothes_in_russia','','-600328566',NULL,NULL,NULL),(2,'2018-07-21 16:22:20',1,'2018-07-21 16:22:20',1,1,NULL,'Y',NULL,NULL,500,'Международная выставка одежды Salon De Fashion',4,'В следующем году состоится выставка одежды - Salon De Fashion, которая обещает быть еще более расширенной и интересной.','html',NULL,'В следующем  году выставка Salon De Fashion обещает быть еще более расширенной и интересной. На выставке Salon De Fashion будут представлены все типы одежды для офиса и дома от платьев и шорт до VIP-аксессуаров, включая оборудование для производства и детской одежды. \r\n					<div>\r\n					<br />\r\n					</div>\r\n\r\n					<div>Заявки на участие подали более чем 1 500 компаний со всего мира. Предполагается, что за время проведения выставки ее посетят более 300 000 тысяч человек. Экспозиция выставки разместится на общей площади 149 871 кв.м. В следующем году эта поистине грандиозная выставка будет проводиться уже в 14-й раз.</div>\r\n				','html','МЕЖДУНАРОДНАЯ ВЫСТАВКА ОДЕЖДЫ SALON DE FASHION\r\nВ СЛЕДУЮЩЕМ ГОДУ СОСТОИТСЯ ВЫСТАВКА ОДЕЖДЫ \r\n- SALON DE FASHION, КОТОРАЯ ОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ И ИНТЕРЕСНОЙ.\r\nВ СЛЕДУЮЩЕМ  ГОДУ ВЫСТАВКА SALON DE FASHION ОБЕЩАЕТ \r\nБЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ И ИНТЕРЕСНОЙ. НА ВЫСТАВКЕ SALON DE FASHION БУДУТ ПРЕДСТАВЛЕНЫ ВСЕ ТИПЫ ОДЕЖДЫ ДЛЯ ОФИСА И ДОМА ОТ ПЛАТЬЕВ И ШОРТ ДО VIP-АКСЕССУАРОВ, ВКЛЮЧАЯ ОБОРУДОВАНИЕ ДЛЯ ПРОИЗВОДСТВА И ДЕТСКОЙ ОДЕЖДЫ.  \r\n\r\n\r\nЗАЯВКИ НА УЧАСТИЕ ПОДАЛИ БОЛЕЕ ЧЕМ 1 500 КОМПАНИЙ \r\nСО ВСЕГО МИРА. ПРЕДПОЛАГАЕТСЯ, ЧТО ЗА ВРЕМЯ ПРОВЕДЕНИЯ ВЫСТАВКИ ЕЕ ПОСЕТЯТ БОЛЕЕ 300 000 ТЫСЯЧ ЧЕЛОВЕК. ЭКСПОЗИЦИЯ ВЫСТАВКИ РАЗМЕСТИТСЯ НА ОБЩЕЙ ПЛОЩАДИ 149 871 КВ.М. В СЛЕДУЮЩЕМ ГОДУ ЭТА ПОИСТИНЕ ГРАНДИОЗНАЯ ВЫСТАВКА БУДЕТ ПРОВОДИТЬСЯ УЖЕ В 14-Й РАЗ.',1,NULL,NULL,NULL,NULL,NULL,'N','8','exhibition_salon_de_fashion','','1890358504',NULL,NULL,NULL),(3,'2018-07-21 16:22:20',1,'2018-07-21 16:22:20',1,1,NULL,'Y',NULL,NULL,500,'Новое веяние в одежде - получено прочное водостойкое соединение',8,'Получено новое прочное водостойкое клеевое соединение.Изобретение относится к области получения и применения клеящих составов, используемых в обработке тканей, кожи и других материалов. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный очень гибкий отвердитель. Который даст возможность делать новые виды аппликаций и соединения тканей и различных типов материалов.','html',9,'<b>Авторы изобретения</b>: Разиньков Егор Михайлович и Зайцева Анна Анатольевна\r\n					<br />\r\n					Патент Российской Федерации RU2277566\r\n					<br />\r\n\r\n					<h3>Описание изобретения</h3>\r\n\r\n					<p>Изобретение относится к области получения и применения клеящих составов, используемых в производстве одежды и аксессуаров. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный гибкий отвердитель. Прототипом клеевой композиции является клей, состоящий из карбамидоформальдегидной смолы, сополимера акрилонитрила с N-винилкапролактамом и отвердитель. В качестве отвердителя применяют хлористый аммоний либо акриловую кислоту. </p>\r\n\r\n					<p>Изобретение решает задачу по получению прочного и водостойкого клеевого соединения. Это достигается тем, что клеевая композиция, включающая синтетическую смолу и отвердитель, согласно изобретению, дополнительно содержит модификатор, причем в качестве синтетической смолы клеевая композиция включает карбамидомеламиноформальдегидную смолу с отвердителем 2542, в качестве модификатора - карбамидоформальдегидную смолу, а в качестве отвердителя - 10%-ный раствор щавелевой кислоты при следующем соотношении компонентов, мас.ч.: </p>\r\n\r\n					<table cellspacing=\"0\">\r\n					<tbody>\r\n					<tr> <td>Карбамидомеламиноформальдегидная смола</td><td>64,5-79,2</td> </tr>\r\n\r\n					<tr> <td>10%-ный Раствор щавелевой кислоты</td><td>4,4-20,5</td> </tr>\r\n\r\n					<tr> <td> Отвердитель для карбамидомеламиноформальдегидной </td><td>0,6-2,0</td> </tr>\r\n\r\n					<tr> <td> смолы 2542</td><td>13,0-15,8</td> </tr>\r\n					</tbody>\r\n					</table>\r\n','html','НОВОЕ ВЕЯНИЕ В ОДЕЖДЕ - ПОЛУЧЕНО ПРОЧНОЕ ВОДОСТОЙКОЕ СОЕДИНЕНИЕ\r\nПОЛУЧЕНО НОВОЕ ПРОЧНОЕ ВОДОСТОЙКОЕ КЛЕЕВОЕ \r\nСОЕДИНЕНИЕ.ИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ ПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, ИСПОЛЬЗУЕМЫХ В ОБРАБОТКЕ ТКАНЕЙ, КОЖИ И ДРУГИХ МАТЕРИАЛОВ. ДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА ТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ ОЧЕНЬ ГИБКИЙ ОТВЕРДИТЕЛЬ. КОТОРЫЙ ДАСТ ВОЗМОЖНОСТЬ ДЕЛАТЬ НОВЫЕ ВИДЫ АППЛИКАЦИЙ И СОЕДИНЕНИЯ ТКАНЕЙ И РАЗЛИЧНЫХ ТИПОВ МАТЕРИАЛОВ.\r\nАВТОРЫ ИЗОБРЕТЕНИЯ: РАЗИНЬКОВ ЕГОР МИХАЙЛОВИЧ \r\nИ ЗАЙЦЕВА АННА АНАТОЛЬЕВНА \r\nПАТЕНТ РОССИЙСКОЙ ФЕДЕРАЦИИ RU2277566 \r\nОПИСАНИЕ ИЗОБРЕТЕНИЯ \r\n\r\nИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ ПОЛУЧЕНИЯ \r\nИ ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, ИСПОЛЬЗУЕМЫХ В ПРОИЗВОДСТВЕ ОДЕЖДЫ И АКСЕССУАРОВ. ДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА ТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ ГИБКИЙ ОТВЕРДИТЕЛЬ. ПРОТОТИПОМ КЛЕЕВОЙ КОМПОЗИЦИИ ЯВЛЯЕТСЯ КЛЕЙ, СОСТОЯЩИЙ ИЗ КАРБАМИДОФОРМАЛЬДЕГИДНОЙ СМОЛЫ, СОПОЛИМЕРА АКРИЛОНИТРИЛА С N-ВИНИЛКАПРОЛАКТАМОМ И ОТВЕРДИТЕЛЬ. В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ ПРИМЕНЯЮТ ХЛОРИСТЫЙ АММОНИЙ ЛИБО АКРИЛОВУЮ КИСЛОТУ. \r\n\r\nИЗОБРЕТЕНИЕ РЕШАЕТ ЗАДАЧУ ПО ПОЛУЧЕНИЮ \r\nПРОЧНОГО И ВОДОСТОЙКОГО КЛЕЕВОГО СОЕДИНЕНИЯ. ЭТО ДОСТИГАЕТСЯ ТЕМ, ЧТО КЛЕЕВАЯ КОМПОЗИЦИЯ, ВКЛЮЧАЮЩАЯ СИНТЕТИЧЕСКУЮ СМОЛУ И ОТВЕРДИТЕЛЬ, СОГЛАСНО ИЗОБРЕТЕНИЮ, ДОПОЛНИТЕЛЬНО СОДЕРЖИТ МОДИФИКАТОР, ПРИЧЕМ В КАЧЕСТВЕ СИНТЕТИЧЕСКОЙ СМОЛЫ КЛЕЕВАЯ КОМПОЗИЦИЯ ВКЛЮЧАЕТ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНУЮ СМОЛУ С ОТВЕРДИТЕЛЕМ 2542, В КАЧЕСТВЕ МОДИФИКАТОРА - КАРБАМИДОФОРМАЛЬДЕГИДНУЮ СМОЛУ, А В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ - 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ ПРИ СЛЕДУЮЩЕМ СООТНОШЕНИИ КОМПОНЕНТОВ, МАС.Ч.: \r\n КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНАЯ СМОЛА \r\n   64,5-79,2     \r\n 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ    4,4-20,5 \r\n    \r\n ОТВЕРДИТЕЛЬ ДЛЯ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНОЙ \r\n    0,6-2,0     \r\n СМОЛЫ 2542    13,0-15,8',1,NULL,NULL,NULL,NULL,NULL,'N','9','waterproof_connection','','-2110133196',NULL,NULL,NULL),(4,'2018-07-21 16:22:27',1,'2018-07-21 16:22:25',1,2,8,'Y',NULL,NULL,810,'Штаны Полосатый Рейс',NULL,'','text',47,'Брюки-клеш идеально сидят и подчеркивают стройность фигуры. Модель имеет застежку на молнию. Изделие будет прекрасно гармонировать с любыми предметами гардероба. Длина изделия ок. 100см. Длина по внутреннему шву ок. 83см. Ширина внизу ок. 87см.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Форма брючин:</b> Широкие брючины</li>\n\n							<li><b>Вид застежки: </b>Молния</li>\n\n							<li><b>По назначению: </b>Повседневные</li>\n\n							<li><b>Сезон: </b>демисезон</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль: </b>Женственный стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						','html','ШТАНЫ ПОЛОСАТЫЙ РЕЙС\r\n\r\nБРЮКИ-КЛЕШ ИДЕАЛЬНО СИДЯТ И ПОДЧЕРКИВАЮТ \r\nСТРОЙНОСТЬ ФИГУРЫ. МОДЕЛЬ ИМЕЕТ ЗАСТЕЖКУ НА МОЛНИЮ. ИЗДЕЛИЕ БУДЕТ ПРЕКРАСНО ГАРМОНИРОВАТЬ С ЛЮБЫМИ ПРЕДМЕТАМИ ГАРДЕРОБА. ДЛИНА ИЗДЕЛИЯ ОК. 100СМ. ДЛИНА ПО ВНУТРЕННЕМУ ШВУ ОК. 83СМ. ШИРИНА ВНИЗУ ОК. 87СМ. \r\n\r\n\r\n\r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n\r\n- ФОРМА БРЮЧИН: ШИРОКИЕ БРЮЧИНЫ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: ЖЕНСТВЕННЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ',1,NULL,NULL,NULL,NULL,NULL,'Y','177','pants-striped-flight','','82682899',NULL,NULL,NULL),(5,'2018-07-21 16:22:27',1,'2018-07-21 16:22:25',1,2,8,'Y',NULL,NULL,380,'Штаны Жизнь в Абстракции',NULL,'','text',48,'Свободные штаны с эффектом свободы, создают дополнительный разогревающий эффект во время ходьбы. Штаны &ndash; незаменимая вещь для репетиций и занятий танцами, прекрасно сочетаются с любым купальником или майкой. Вся одежда отечественной компании Grishko производится в России!\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вид застежки:</b> Завязки</li>\n\n							<li><b>По назначению:</b> Спорт</li>\n\n							<li><b>Габариты предметов:</b> Длина, 58.0 см</li>\n\n							<li><b>Брюки: </b>Ширина брючин, 28.0 см</li>\n\n							<li><b>Брюки: </b>Высота посадки, 30.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 29.0 см</li>\n\n							<li><b>Сезон: </b>демисезон</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Спортивный стиль</li>\n\n							<li><b>Страна бренда: </b>Россия</li>\n							</ul>\n							</div>\n							</div>\n						','html','ШТАНЫ ЖИЗНЬ В АБСТРАКЦИИ\r\n\r\nСВОБОДНЫЕ ШТАНЫ С ЭФФЕКТОМ СВОБОДЫ, СОЗДАЮТ \r\nДОПОЛНИТЕЛЬНЫЙ РАЗОГРЕВАЮЩИЙ ЭФФЕКТ ВО ВРЕМЯ ХОДЬБЫ. ШТАНЫ &NDASH; НЕЗАМЕНИМАЯ ВЕЩЬ ДЛЯ РЕПЕТИЦИЙ И ЗАНЯТИЙ ТАНЦАМИ, ПРЕКРАСНО СОЧЕТАЮТСЯ С ЛЮБЫМ КУПАЛЬНИКОМ ИЛИ МАЙКОЙ. ВСЯ ОДЕЖДА ОТЕЧЕСТВЕННОЙ КОМПАНИИ GRISHKO ПРОИЗВОДИТСЯ В РОССИИ! \r\n\r\n\r\n\r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n\r\n- ВИД ЗАСТЕЖКИ: ЗАВЯЗКИ \r\n- ПО НАЗНАЧЕНИЮ: СПОРТ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 58.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 28.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 30.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 29.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ',1,NULL,NULL,NULL,NULL,NULL,'Y','207','pants-life-in-abstraction','','1558207682',NULL,NULL,NULL),(6,'2018-07-21 16:22:27',1,'2018-07-21 16:22:25',1,2,8,'Y',NULL,NULL,100,'Штаны Цветочная Поляна',NULL,'Прекрасные штаны, длинные, выполненные из цветного материала. Свободный крой дарит комфорт и уверенность движений. Отличный вариант для женского гардероба.','text',49,'Великолепные брюки фасона широкий клеш помогут создать стильный костюм. Модель удобно застегиваются на молнию сбоку. Такие брюки позволят обратить на Вас внимание окружающих и придать Вашему виду экстравагантность.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Форма брючин:</b> Широкий клеш</li>\n\n							<li><b>Вид застежки:</b><span class=\"Apple-tab-span\" style=\"white-space: pre;\">	</span>Молния</li>\n\n							<li><b>По назначению:</b> Повседневные</li>\n\n							<li><b>Габариты предметов:</b> Длина, 103.5 см</li>\n\n							<li><b>Брюки:</b> Ширина брючин, 48.0 см</li>\n\n							<li><b>Брюки:</b> Высота посадки, 24.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 82.0 см</li>\n\n							<li><b>Сезон:</b> лето</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль:</b> Деловой стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						','html','ШТАНЫ ЦВЕТОЧНАЯ ПОЛЯНА\r\nПРЕКРАСНЫЕ ШТАНЫ, ДЛИННЫЕ, ВЫПОЛНЕННЫЕ ИЗ ЦВЕТНОГО МАТЕРИАЛА. СВОБОДНЫЙ КРОЙ ДАРИТ КОМФОРТ И УВЕРЕННОСТЬ ДВИЖЕНИЙ. ОТЛИЧНЫЙ ВАРИАНТ ДЛЯ ЖЕНСКОГО ГАРДЕРОБА.\r\nВЕЛИКОЛЕПНЫЕ БРЮКИ ФАСОНА ШИРОКИЙ КЛЕШ \r\nПОМОГУТ СОЗДАТЬ СТИЛЬНЫЙ КОСТЮМ. МОДЕЛЬ УДОБНО ЗАСТЕГИВАЮТСЯ НА МОЛНИЮ СБОКУ. ТАКИЕ БРЮКИ ПОЗВОЛЯТ ОБРАТИТЬ НА ВАС ВНИМАНИЕ ОКРУЖАЮЩИХ И ПРИДАТЬ ВАШЕМУ ВИДУ ЭКСТРАВАГАНТНОСТЬ. \r\n\r\n\r\n\r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n\r\n- ФОРМА БРЮЧИН: ШИРОКИЙ КЛЕШ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 103.5 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 48.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 24.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 82.0 СМ \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: ДЕЛОВОЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ',1,NULL,NULL,NULL,NULL,NULL,'Y','223','pants-flower-glade','','618159361',NULL,NULL,NULL),(7,'2018-07-21 16:22:27',1,'2018-07-21 16:22:25',1,2,7,'Y',NULL,NULL,690,'Платье Модница на Прогулке',NULL,'','text',50,'Великолепное и стильное платье поможет создать незабываемый образ. Оригинальный покрой и длина выгодно подчеркнут все достоинства Вашей фигуры. Отличный вариант для любого случая.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина изделия:</b> Миди, 92.0 см</li>\n\n							<li><b>Длина рукава:</b> Короткие, 12.0 см</li>\n\n							<li><b>Сезон: </b>демисезон</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль:</b> Casual</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						','html','ПЛАТЬЕ МОДНИЦА НА ПРОГУЛКЕ\r\n\r\nВЕЛИКОЛЕПНОЕ И СТИЛЬНОЕ ПЛАТЬЕ ПОМОЖЕТ \r\nСОЗДАТЬ НЕЗАБЫВАЕМЫЙ ОБРАЗ. ОРИГИНАЛЬНЫЙ ПОКРОЙ И ДЛИНА ВЫГОДНО ПОДЧЕРКНУТ ВСЕ ДОСТОИНСТВА ВАШЕЙ ФИГУРЫ. ОТЛИЧНЫЙ ВАРИАНТ ДЛЯ ЛЮБОГО СЛУЧАЯ. \r\n\r\n\r\n\r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n\r\n- ДЛИНА ИЗДЕЛИЯ: МИДИ, 92.0 СМ \r\n- ДЛИНА РУКАВА: КОРОТКИЕ, 12.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: CASUAL \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ',1,NULL,NULL,NULL,NULL,NULL,'Y','253','dress-fashionista-on-a-walk','','1749109779',NULL,NULL,NULL),(8,'2018-07-21 16:22:27',1,'2018-07-21 16:22:25',1,2,7,'Y',NULL,NULL,750,'Платье Весенняя Легкость',NULL,'','text',56,'Трикотажное платье без рукавов и округлым вырезом горловины. Небольшие складк