: </b>Длина, 75.0 см</li>\n\n							<li><b>Брюки: </b>Ширина брючин, 34.0 см</li>\n\n							<li><b>Брюки: </b>Высота посадки, 28.0 см</li>\n\n							<li><b>Брюки: </b>Длина по внутреннему шву, 78.0 см</li>\n\n							<li><b>Сезон: </b>демисезон</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль: </b>Спортивный стиль</li>\n\n							<li><b>Страна бренда: </b>Швеция</li>\n\n							<li><b>Страна производитель: </b>Китай</li>\n							</ul>\n							</div>\n							</div>\n						','html','СПОРТИВНЫЙ КОСТЮМ НЕЖНАЯ ТЕПЛОТА\r\n\r\nЗАМЕЧАТЕЛЬНЫЙ СПОРТИВНЫЙ КОСТЮМ, СОСТОЯЩИЙ \r\nИЗ КУРТКИ И БРЮК. МАНЖЕТЫ, ТАЛИЯ, НИЗ ИЗДЕЛИЯ И КАПЮШОН РЕГУЛИРУЮТСЯ В 2 НАПРАВЛЕНИЯХ ОДНОЙ РУКОЙ. КАПЮШОН СВОРАЧИВАЕТСЯ И УБИРАЕТСЯ В ВОРОТ ПОД МОЛНИЮ. ИЗДЕЛИЯ ЛЕГКО СКЛАДЫВАЮТСЯ В МАЛЕНЬКУЮ СУМОЧКУ, КОТОРАЯ ИДЕТ В КОМПЛЕКТЕ К КОСТЮМУ. \r\n\r\n\r\n\r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n\r\n- ВИД ЗАСТЕЖКИ: ЛИПУЧКА \r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 79.0 СМ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ТИП КАРМАНОВ: ВТАЧНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 75.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 34.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 28.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 78.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: ШВЕЦИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ',1,NULL,NULL,NULL,NULL,NULL,'Y','404','sports-suit-gentle-warmth','','-1343307417',NULL,NULL,NULL),(24,'2018-07-21 16:22:27',1,'2018-07-21 16:22:26',1,2,11,'Y',NULL,NULL,400,'Спортивный Костюм Огонь в Ночи',NULL,'','text',146,'Превосходный спортивный костюм, состоящий из толстовки и брюк. Толстовка имеет застежку на молнию и воротник &quot;стойка&quot;. Низ изделия эластичный. Толстовка оформлена декоративными вставками яркого контрастного цвета. Спортивные брюки прямого покроя имеют удобный эластичный пояс и прорезные карманы.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вид застежки:</b> Шнурки</li>\n\n							<li><b>Длина рукава:</b> Длинные, 62.0 см</li>\n\n							<li><b>Вид застежки:</b> Молния</li>\n\n							<li><b>Тип карманов:</b> Прорезные</li>\n\n							<li><b>Габариты предметов:</b> Длина, 55.0 см</li>\n\n							<li><b>Брюки:</b> Ширина брючин, 22.0 см</li>\n\n							<li><b>Брюки:</b> Высота посадки, 21.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 83.0 см</li>\n\n							<li><b>Сезон:</b> круглогодичный</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Спортивный стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n\n							<div>\n							<br />\n							</div>\n							</div>\n							</div>\n						','html','СПОРТИВНЫЙ КОСТЮМ ОГОНЬ В НОЧИ\r\n\r\nПРЕВОСХОДНЫЙ СПОРТИВНЫЙ КОСТЮМ, СОСТОЯЩИЙ \r\nИЗ ТОЛСТОВКИ И БРЮК. ТОЛСТОВКА ИМЕЕТ ЗАСТЕЖКУ НА МОЛНИЮ И ВОРОТНИК \"СТОЙКА\". НИЗ ИЗДЕЛИЯ ЭЛАСТИЧНЫЙ. ТОЛСТОВКА ОФОРМЛЕНА ДЕКОРАТИВНЫМИ ВСТАВКАМИ ЯРКОГО КОНТРАСТНОГО ЦВЕТА. СПОРТИВНЫЕ БРЮКИ ПРЯМОГО ПОКРОЯ ИМЕЮТ УДОБНЫЙ ЭЛАСТИЧНЫЙ ПОЯС И ПРОРЕЗНЫЕ КАРМАНЫ. \r\n\r\n\r\n\r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n\r\n- ВИД ЗАСТЕЖКИ: ШНУРКИ \r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 62.0 СМ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ТИП КАРМАНОВ: ПРОРЕЗНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 55.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 22.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 21.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 83.0 СМ \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ',1,NULL,NULL,NULL,NULL,NULL,'Y','413','sports-suit-fire-in-the-night','','-1937297498',NULL,NULL,NULL),(25,'2018-07-21 16:22:27',1,'2018-07-21 16:22:26',1,2,11,'Y',NULL,NULL,500,'Спортивный Костюм Элегантность в Ночи',NULL,'','text',152,'Замечательный спортивный костюм, состоящий из толстовки и брюк. Толстовка с длинными рукавами застегивается на молнию и дополнена удобными карманами. Брюки на эластичном поясе. Длина брюк ок. 101 см.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина рукава:</b> Длинные, 74.0 см</li>\n\n							<li><b>Вид застежки:</b> Молния</li>\n\n							<li><b>Габариты предметов:</b> Длина, 65.0 см</li>\n\n							<li><b>Брюки:</b> Ширина брючин, 23.0 см</li>\n\n							<li><b>Брюки:</b> Высота посадки, 24.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 80.0 см</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Страна бренда:</b> Германия</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						','html','СПОРТИВНЫЙ КОСТЮМ ЭЛЕГАНТНОСТЬ В НОЧИ\r\n\r\nЗАМЕЧАТЕЛЬНЫЙ СПОРТИВНЫЙ КОСТЮМ, СОСТОЯЩИЙ \r\nИЗ ТОЛСТОВКИ И БРЮК. ТОЛСТОВКА С ДЛИННЫМИ РУКАВАМИ ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ И ДОПОЛНЕНА УДОБНЫМИ КАРМАНАМИ. БРЮКИ НА ЭЛАСТИЧНОМ ПОЯСЕ. ДЛИНА БРЮК ОК. 101 СМ. \r\n\r\n\r\n\r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n\r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 74.0 СМ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 65.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 23.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 24.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 80.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: ГЕРМАНИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ',1,NULL,NULL,NULL,NULL,NULL,'Y','422','sports-suit-elegance-in-the-night','','-1230115635',NULL,NULL,NULL),(26,'2018-07-21 16:22:27',1,'2018-07-21 16:22:26',1,2,11,'Y',NULL,NULL,730,'Спортивный Костюм Розовый Вихрь',NULL,'','text',158,'Великолепный спортивный костюм состоящий из свитшота и брюк. Свитшот с длинными рукавами и капюшоном на спинке декорирован принтом с нанесением шелкографии. Брюки прямого кроя выполнены на поясе на эластичной резинке, низ оформлен трикотажными манжетами. Прекрасный вариант как для занятий спортом, так и для повседневной носки.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>