		<div>\n							<ul>\n							<li><b>Вырез горловины:</b> V-образный вырез</li>\n\n							<li><b>Длина изделия:</b> Мини, 90.0 см</li>\n\n							<li><b>По назначению:</b> Повседневные</li>\n\n							<li><b>Длина рукава:</b> Без рукавов</li>\n\n							<li><b>Вид бретелек:</b> Тонкие бретельки</li>\n\n							<li><b>Габариты предметов:</b><span class=\"Apple-tab-span\" style=\"white-space: pre;\">	</span> Длина, 94.0 см</li>\n\n							<li><b>Брюки:</b> Ширина брючин, 30.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 13.0 см</li>\n\n							<li><b>Сезон</b>: лето</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Спортивный стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						','html','СПОРТИВНЫЙ КОСТЮМ ДЫХАНИЕ СПОРТА\r\n\r\nОЧАРОВАТЕЛЬНЫЙ КОМБИНЕЗОН С ТОНКОЙ БРЕТЕЛЬ-АМЕРИКАНКА. \r\nОБЛЕГАЮЩИЙ СИЛУЭТ. ЭФФЕКТНАЯ МОДЕЛЬ, КОТОРАЯ ПОМОЖЕТ ПОДЧЕРКНУТЬ ДОСТОИНСТВА ВАШЕЙ ФИГУРЫ. ПРАКТИЧНЫЙ ВАРИАНТ ДЛЯ ЗАНЯТИЙ СПОРТОМ. \r\n\r\n\r\n\r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n\r\n- ВЫРЕЗ ГОРЛОВИНЫ: V-ОБРАЗНЫЙ ВЫРЕЗ \r\n- ДЛИНА ИЗДЕЛИЯ: МИНИ, 90.0 СМ \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- ДЛИНА РУКАВА: БЕЗ РУКАВОВ \r\n- ВИД БРЕТЕЛЕК: ТОНКИЕ БРЕТЕЛЬКИ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 94.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 30.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 13.0 СМ \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ',1,NULL,NULL,NULL,NULL,NULL,'Y','447','sports-suit-breath-sports','','68757474',NULL,NULL,NULL),(28,'2018-07-21 16:22:27',1,'2018-07-21 16:22:26',1,2,11,'Y',NULL,NULL,720,'Спортивный Костюм Вечерний Спорт',NULL,'Прекрасный комплект, состоящий из футболки с округлым вырезом горловины и короткими рукавами и шорт. Модель выполнена из качественного материала. Отличный вариант на каждый день.','text',170,'Платье из коллекции Марии Шараповой, российской теннисистки, 2-ой ракетки мира, заслуженного мастера спорта. Особенности включают в себя Dri-FIT - легкая и дышащая ткань, обеспечивающая спортсменам сухость и комфорт. Конструкция плоских швов сводит натирание к нулю, предотвращая появление раздражения. Сетчатые вставки на теплостойкой поверхности улучшают вентиляцию. Вшитое бра со вставками из сетчатой ткани обеспечивает эффективную поддержку и вентиляцию. Swoosh логотип дополняет.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина изделия: </b>Мини, 80.0 см</li>\n\n							<li><b>По назначению:</b> Спорт</li>\n\n							<li><b>Длина рукава:</b> Без рукавов</li>\n\n							<li><b>Вид бретелек:</b> Тонкие бретельки</li>\n\n							<li><b>Сезон:</b> лето</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Спортивный стиль</li>\n\n							<li><b>Страна бренда:</b> Соединенные Штаты</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						','html','СПОРТИВНЫЙ КОСТЮМ ВЕЧЕРНИЙ СПОРТ\r\nПРЕКРАСНЫЙ КОМПЛЕКТ, СОСТОЯЩИЙ ИЗ ФУТБОЛКИ С ОКРУГЛЫМ ВЫРЕЗОМ ГОРЛОВИНЫ И КОРОТКИМИ РУКАВАМИ И ШОРТ. МОДЕЛЬ ВЫПОЛНЕНА ИЗ КАЧЕСТВЕННОГО МАТЕРИАЛА. ОТЛИЧНЫЙ ВАРИАНТ НА КАЖДЫЙ ДЕНЬ.\r\nПЛАТЬЕ ИЗ КОЛЛЕКЦИИ МАРИИ ШАРАПОВОЙ, РОССИЙСКОЙ \r\nТЕННИСИСТКИ, 2-ОЙ РАКЕТКИ МИРА, ЗАСЛУЖЕННОГО МАСТЕРА СПОРТА. ОСОБЕННОСТИ ВКЛЮЧАЮТ В СЕБЯ DRI-FIT - ЛЕГКАЯ И ДЫШАЩАЯ ТКАНЬ, ОБЕСПЕЧИВАЮЩАЯ СПОРТСМЕНАМ СУХОСТЬ И КОМФОРТ. КОНСТРУКЦИЯ ПЛОСКИХ ШВОВ СВОДИТ НАТИРАНИЕ К НУЛЮ, ПРЕДОТВРАЩАЯ ПОЯВЛЕНИЕ РАЗДРАЖЕНИЯ. СЕТЧАТЫЕ ВСТАВКИ НА ТЕПЛОСТОЙКОЙ ПОВЕРХНОСТИ УЛУЧШАЮТ ВЕНТИЛЯЦИЮ. ВШИТОЕ БРА СО ВСТАВКАМИ ИЗ СЕТЧАТОЙ ТКАНИ ОБЕСПЕЧИВАЕТ ЭФФЕКТИВНУЮ ПОДДЕРЖКУ И ВЕНТИЛЯЦИЮ. SWOOSH ЛОГОТИП ДОПОЛНЯЕТ. \r\n\r\n\r\n\r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n\r\n- ДЛИНА ИЗДЕЛИЯ: МИНИ, 80.0 СМ \r\n- ПО НАЗНАЧЕНИЮ: СПОРТ \r\n- ДЛИНА РУКАВА: БЕЗ РУКАВОВ \r\n- ВИД БРЕТЕЛЕК: ТОНКИЕ БРЕТЕЛЬКИ \r\n- СЕЗОН: ЛЕТО \r\n