INSERT INTO `b_iblock_section` VALUES (1,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,NULL,'Y','Y',50,'Обувь',32,1,12,1,'Сложно представить себе элементы гардероба современного человека, которые выбирались бы более тщательно и основательно, чем обувь. Это больше, чем просто стильный аксессуар: ботинки, сапоги, туфли и другие модели выполняют очень важную функцию – они отвечают за комфорт, а иногда и за здоровье ног.<br />\n					<br />\n				','html','ОБУВЬ\r\nСЛОЖНО ПРЕДСТАВИТЬ СЕБЕ ЭЛЕМЕНТЫ ГАРДЕРОБА \r\nСОВРЕМЕННОГО ЧЕЛОВЕКА, КОТОРЫЕ ВЫБИРАЛИСЬ БЫ БОЛЕЕ ТЩАТЕЛЬНО И ОСНОВАТЕЛЬНО, ЧЕМ ОБУВЬ. ЭТО БОЛЬШЕ, ЧЕМ ПРОСТО СТИЛЬНЫЙ АКСЕССУАР: БОТИНКИ, САПОГИ, ТУФЛИ И ДРУГИЕ МОДЕЛИ ВЫПОЛНЯЮТ ОЧЕНЬ ВАЖНУЮ ФУНКЦИЮ – ОНИ ОТВЕЧАЮТ ЗА КОМФОРТ, А ИНОГДА И ЗА ЗДОРОВЬЕ НОГ.','shoes','19',NULL,NULL,NULL),(2,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,1,'Y','Y',500,'Пантолеты',33,2,3,2,'Женские пантолеты – обувь, которая только с виду кажется непрактичной и простой. На самом деле, эти легкие и изящные шлепанцы универсальны: современные девушки все чаще выбирают их не только в качестве пляжной обуви, но и как удобный вариант на каждый день. Конечно, такая обувь в рамках офисного образа вряд ли станет удачным решением, однако в остальном у представительниц прекрасного пола – абсолютная свобода выбора.<br />\n							<br />\n						','html','ПАНТОЛЕТЫ\r\nЖЕНСКИЕ ПАНТОЛЕТЫ – ОБУВЬ, КОТОРАЯ ТОЛЬКО \r\nС ВИДУ КАЖЕТСЯ НЕПРАКТИЧНОЙ И ПРОСТОЙ. НА САМОМ ДЕЛЕ, ЭТИ ЛЕГКИЕ И ИЗЯЩНЫЕ ШЛЕПАНЦЫ УНИВЕРСАЛЬНЫ: СОВРЕМЕННЫЕ ДЕВУШКИ ВСЕ ЧАЩЕ ВЫБИРАЮТ ИХ НЕ ТОЛЬКО В КАЧЕСТВЕ ПЛЯЖНОЙ ОБУВИ, НО И КАК УДОБНЫЙ ВАРИАНТ НА КАЖДЫЙ ДЕНЬ. КОНЕЧНО, ТАКАЯ ОБУВЬ В РАМКАХ ОФИСНОГО ОБРАЗА ВРЯД ЛИ СТАНЕТ УДАЧНЫМ РЕШЕНИЕМ, ОДНАКО В ОСТАЛЬНОМ У ПРЕДСТАВИТЕЛЬНИЦ ПРЕКРАСНОГО ПОЛА – АБСОЛЮТНАЯ СВОБОДА ВЫБОРА.','pantolety','26',NULL,NULL,NULL),(3,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,1,'Y','Y',500,'Тапочки',34,4,5,2,'Яркие, удобные женские и мужские тапочки: для домашнего уюта и полноценного отдыха. Эта обувь помогает расслабиться после тяжелого и напряженного дня.\n							</br></br>\n							Так приятно, придя домой, сменить тесные туфли или туфли на высоком каблуке на комфортные тапочки.\n							</br></br>','html','ТАПОЧКИ\r\nЯРКИЕ, УДОБНЫЕ ЖЕНСКИЕ И МУЖСКИЕ ТАПОЧКИ: \r\nДЛЯ ДОМАШНЕГО УЮТА И ПОЛНОЦЕННОГО ОТДЫХА. ЭТА ОБУВЬ ПОМОГАЕТ РАССЛАБИТЬСЯ ПОСЛЕ ТЯЖЕЛОГО И НАПРЯЖЕННОГО ДНЯ. ТАК ПРИЯТНО, ПРИДЯ ДОМОЙ, СМЕНИТЬ ТЕСНЫЕ ТУФЛИ ИЛИ ТУФЛИ НА ВЫСОКОМ КАБЛУКЕ НА КОМФОРТНЫЕ ТАПОЧКИ.','slippers','32',NULL,NULL,NULL),(4,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,1,'Y','Y',500,'Туфли',35,6,11,2,'<br />\n							<br />\n						','html','ТУФЛИ\r\n','shoess','29',NULL,NULL,NULL),(5,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,4,'Y','Y',500,' Туфли Женские',36,7,8,3,'Считается, что женские туфли – это своеобразный «индикатор» наличия у девушки вкуса. Неправильно выбранная обувь может свести на нет все усилия по составлению эффектного и стильного образа. В то время как удачно выбранные женские туфли станут ярким акцентом даже самого скромного ансамбля.','html',' ТУФЛИ ЖЕНСКИЕ\r\nСЧИТАЕТСЯ, ЧТО ЖЕНСКИЕ ТУФЛИ – ЭТО СВОЕОБРАЗНЫЙ \r\n«ИНДИКАТОР» НАЛИЧИЯ У ДЕВУШКИ ВКУСА. НЕПРАВИЛЬНО ВЫБРАННАЯ ОБУВЬ МОЖЕТ СВЕСТИ НА НЕТ ВСЕ УСИЛИЯ ПО СОСТАВЛЕНИЮ ЭФФЕКТНОГО И СТИЛЬНОГО ОБРАЗА. В ТО ВРЕМЯ КАК УДАЧНО ВЫБРАННЫЕ ЖЕНСКИЕ ТУФЛИ СТАНУТ ЯРКИМ АКЦЕНТОМ ДАЖЕ САМОГО СКРОМНОГО АНСАМБЛЯ.','women-s-shoes','31',NULL,NULL,NULL),(6,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,4,'Y','Y',500,'Туфли Мужские',37,9,10,3,'Мужская обувь, предлагаемая современными брендами представителям сильного пола, невероятно разнообразна. Касается это не только огромного количества всевозможных форм, но и различных стилевых отличий. Дело в том, что сегодня стало невероятно популярным смешение различных направлений и стилей, поэтому иногда даже в самых строгих ботинках можно найти легкие спортивные нотки.<br />\n								','html','ТУФЛИ МУЖСКИЕ\r\nМУЖСКАЯ ОБУВЬ, ПРЕДЛАГАЕМАЯ СОВРЕМЕННЫМИ \r\nБРЕНДАМИ ПРЕДСТАВИТЕЛЯМ СИЛЬНОГО ПОЛА, НЕВЕРОЯТНО РАЗНООБРАЗНА. КАСАЕТСЯ ЭТО НЕ ТОЛЬКО ОГРОМНОГО КОЛИЧЕСТВА ВСЕВОЗМОЖНЫХ ФОРМ, НО И РАЗЛИЧНЫХ СТИЛЕВЫХ ОТЛИЧИЙ. ДЕЛО В ТОМ, ЧТО СЕГОДНЯ СТАЛО НЕВЕРОЯТНО ПОПУЛЯРНЫМ СМЕШЕНИЕ РАЗЛИЧНЫХ НАПРАВЛЕНИЙ И СТИЛЕЙ, ПОЭТОМУ ИНОГДА ДАЖЕ В САМЫХ СТРОГИХ БОТИНКАХ МОЖНО НАЙТИ ЛЕГКИЕ СПОРТИВНЫЕ НОТКИ.','shoes-mens','30',NULL,NULL,NULL),(7,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,NULL,'Y','Y',100,'Платья',38,13,14,1,NULL,'text','ПЛАТЬЯ\r\n','dresses','20',NULL,NULL,NULL),(8,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,NULL,'Y','Y',200,'Штаны',39,15,16,1,NULL,'text','ШТАНЫ\r\n','pants','25',NULL,NULL,NULL),(9,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,NULL,'Y','Y',300,'Нижнее белье',40,17,18,1,NULL,'text','НИЖНЕЕ БЕЛЬЕ\r\n','underwear','23',NULL,NULL,NULL),(10,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,NULL,'Y','Y',400,'Футболки',41,19,20,1,NULL,'text','ФУТБОЛКИ\r\n','t-shirts','22',NULL,NULL,NULL),(11,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,NULL,'Y','Y',500,'Спортивная Одежда',42,21,22,1,NULL,'text','СПОРТИВНАЯ ОДЕЖДА\r\n','sportswear','21',NULL,NULL,NULL),(12,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,NULL,'Y','Y',700,'Аксессуары',43,23,30,1,'Без аксессуаров вряд ли получится создать стильный, завершенный и индивидуальный образ. Важно обращать внимание на то, насколько гармонично такие элементы будут смотреться в сочетании с тем или иным стилем в одежде, в рамках какого-либо мероприятия.<br />\n				','html','АКСЕССУАРЫ\r\nБЕЗ АКСЕССУАРОВ ВРЯД ЛИ ПОЛУЧИТСЯ СОЗДАТЬ \r\nСТИЛЬНЫЙ, ЗАВЕРШЕННЫЙ И ИНДИВИДУАЛЬНЫЙ ОБРАЗ. ВАЖНО ОБРАЩАТЬ ВНИМАНИЕ НА ТО, НАСКОЛЬКО ГАРМОНИЧНО ТАКИЕ ЭЛЕМЕНТЫ БУДУТ СМОТРЕТЬСЯ В СОЧЕТАНИИ С ТЕМ ИЛИ ИНЫМ СТИЛЕМ В ОДЕЖДЕ, В РАМКАХ КАКОГО-ЛИБО МЕРОПРИЯТИЯ.','accessories','24',NULL,NULL,NULL),(13,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,12,'Y','Y',500,'Ремни',44,24,29,2,'Модные женские пояса и ремни – это атрибут современной и стильной женщины, а также часть тщательно продуманного наряда. Придерживают ли они брюки на своем месте или эффектно подчеркивают талию, выполняют декоративную функцию или чисто практичную – не важно. ','html','РЕМНИ\r\nМОДНЫЕ ЖЕНСКИЕ ПОЯСА И РЕМНИ – ЭТО АТРИБУТ \r\nСОВРЕМЕННОЙ И СТИЛЬНОЙ ЖЕНЩИНЫ, А ТАКЖЕ ЧАСТЬ ТЩАТЕЛЬНО ПРОДУМАННОГО НАРЯДА. ПРИДЕРЖИВАЮТ ЛИ ОНИ БРЮКИ НА СВОЕМ МЕСТЕ ИЛИ ЭФФЕКТНО ПОДЧЕРКИВАЮТ ТАЛИЮ, ВЫПОЛНЯЮТ ДЕКОРАТИВНУЮ ФУНКЦИЮ ИЛИ ЧИСТО ПРАКТИЧНУЮ – НЕ ВАЖНО.','belts','33',NULL,NULL,NULL),(14,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,13,'Y','Y',500,'Ремни Женские',45,25,26,3,'Женские ремни – это атрибут современной женщины, а также часть тщательно продуманного наряда. Придерживают ли они брюки на своем месте или эффектно подчеркивают талию, выполняют декоративную функцию или чисто практичную. Главное заключается в том, что для женщин ремень – это один из самых значимых аксессуаров. ','html','РЕМНИ ЖЕНСКИЕ\r\nЖЕНСКИЕ РЕМНИ – ЭТО АТРИБУТ СОВРЕМЕННОЙ \r\nЖЕНЩИНЫ, А ТАКЖЕ ЧАСТЬ ТЩАТЕЛЬНО ПРОДУМАННОГО НАРЯДА. ПРИДЕРЖИВАЮТ ЛИ ОНИ БРЮКИ НА СВОЕМ МЕСТЕ ИЛИ ЭФФЕКТНО ПОДЧЕРКИВАЮТ ТАЛИЮ, ВЫПОЛНЯЮТ ДЕКОРАТИВНУЮ ФУНКЦИЮ ИЛИ ЧИСТО ПРАКТИЧНУЮ. ГЛАВНОЕ ЗАКЛЮЧАЕТСЯ В ТОМ, ЧТО ДЛЯ ЖЕНЩИН РЕМЕНЬ – ЭТО ОДИН ИЗ САМЫХ ЗНАЧИМЫХ АКСЕССУАРОВ.','women-s-belts','34',NULL,NULL,NULL),(15,'2018-07-21 13:22:25',1,'2018-07-21 16:22:25',1,2,13,'Y','Y',500,'Ремни Мужские',46,27,28,3,'Стильные и качественные мужские ремни – обязательные аксессуары в гардеробе каждого современного представителя сильного пола, внимательно относящегося к своему внешнему виду. Правильно выбранный ремень поможет сделать образ завершенным, респектабельным и солидным.','html','РЕМНИ МУЖСКИЕ\r\nСТИЛЬНЫЕ И КАЧЕСТВЕННЫЕ МУЖСКИЕ РЕМНИ \r\n– ОБЯЗАТЕЛЬНЫЕ АКСЕССУАРЫ В ГАРДЕРОБЕ КАЖДОГО СОВРЕМЕННОГО ПРЕДСТАВИТЕЛЯ СИЛЬНОГО ПОЛА, ВНИМАТЕЛЬНО ОТНОСЯЩЕГОСЯ К СВОЕМУ ВНЕШНЕМУ ВИДУ. ПРАВИЛЬНО ВЫБРАННЫЙ РЕМЕНЬ ПОМОЖЕТ СДЕЛАТЬ ОБРАЗ ЗАВЕРШЕННЫМ, РЕСПЕКТАБЕЛЬНЫМ И СОЛИДНЫМ.','men-s-belts','35',NULL,NULL,NULL);
