','N','Y',NULL,935,'N','N'),(7,7,NULL,'Сбербанк','Сбербанк',NULL,110,'Вы можете оплатить заказ в любом отделении Сбербанка. За услугу по переводу денег с Вас возьмут от 3 до 7% от стоимости заказа, в зависимости от региона. Перечисление денег займет до 10 дней.','sberbank','','Y','Y',NULL,'a:1:{s:16:\"BX_PAY_SYSTEM_ID\";i:7;}',NULL,'Y','N','N','N','N','N','N','Y',NULL,936,'N','N'),(8,8,NULL,'Банковский перевод','Банковский перевод',NULL,100,'','bill','','Y','Y',NULL,'a:1:{s:16:\"BX_PAY_SYSTEM_ID\";i:8;}',NULL,'Y','N','N','N','N','N','N','Y',NULL,937,'N','N'),(9,NULL,NULL,'Внутренний счет','Внутренний счет',NULL,100,NULL,'inner',NULL,'N','Y',NULL,NULL,NULL,'N','N','N','N','N','N','N','Y',NULL,938,'N','N');
