INSERT INTO `b_search_content` VALUES (1,'2018-07-21 16:22:16','main','s1|/store/index.php',0,NULL,NULL,NULL,'/store/index.php','Склады','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(2,'2018-07-21 16:22:16','main','s1|/about/contacts/index.php',0,NULL,NULL,NULL,'/about/contacts/index.php','Задайте вопрос','Телефон:\r8 (495) 212 85 06\rАдрес:\rг. Москва, ул. 2-я Хуторская, д. 38\rПросмотреть увеличенную карту\rЗадать вопрос','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(3,'2018-07-21 16:22:16','main','s1|/about/delivery/index.php',0,NULL,NULL,NULL,'/about/delivery/index.php','Доставка','Интернет-магазин выполняет доставку любого товара своей собственной Службой доставки.\rСтоимость доставки курьером\rСтоимость доставки товара из нашего магазина - 500 руб, при условии выбора при заказе товара в качестве способа доставки нашим курьером.\rВремя доставки\rВремя доставки согласовывается с менеджером Службы доставки, который обязательно свяжется с вами сразу после того, как вы разместите свой заказ. \rВнимание!\rНеправильно указанный номер телефона, неточный или неполный адрес могут привести к дополнительной задержке! Пожалуйста, внимательно проверяйте ваши персональные данные при регистрации и оформлении заказа.Конфиденциальность ваших регистрационных данных гарантируется.\rДоставка выполняется ежедневно с 10:00 до 20:00 часов, в субботу с 10:00 до 14:00, в воскресенье доставки нет. Товары, заказанные вами в субботу и воскресенье, доставляются в понедельник. Время осуществления доставки зависит от времени размещения заказа и наличия товара на складе:\rесли заказ подтвержден менеджером Службы доставки до 12:00, товар может быть доставлен на следующий рабочий день между 10:00 и 15:00 или между 15:00 и 20:00;\nесли заказ подтвержден менеджером Службы доставки после 12:00, товар может быть доставлен на следующий рабочий день между 15:00 и 18:00.\nВы также можете указать любое другое удобное время доставки, и покупка будет доставлена в удобное вам время. Иное время доставки, а также время доставки в населенные пункты области определяется по договоренности с клиентом.\rМесто доставки\rДоставка осуществляется по адресу, указанному при оформлении заказа. Если необходимо доставить товар по иному адресу, необходимо сообщить адрес менеджеру Службы доставки, который свяжется с вами непосредственно после оформления заказа на сайте.\rПравила\rПри доставке вам будут переданы все необходимые документы на покупку: товарный, кассовый чеки, а также гарантийный талон.При оформлении покупки на организацию, вам будут переданы счет-фактура, а также накладная, в которой необходимо поставить печать вашей организации.Цена, указанная в переданных вам курьером документах, является окончательной, курьер не обладает правом корректировки цены.Стоимость доставки выделяется в документах на покупку отдельной графой.\rВнимание!\rПросим вас помнить, что все технические параметры и потребительские свойства приобретаемого товара вам следует уточнять у нашего менеджера до момента покупки товара. В обязанности работников Службы доставки не входит осуществление консультаций и комментариев относительно потребительских свойств товара. При необходимости инсталляции приобретаемого в нашем магазине товара вам необходимо сообщить об этом нашему менеджеру.При доставке вам заказанного товара проверяйте комплектность доставленного товара, работоспособность товара, соответствие доставленного товара описанию на нашем сайте, также проверьте товар на наличие механических повреждений. При не заявлении вами при получении товара претензий по поводу механических повреждений, в дальнейшем подобные претензии не рассматриваются. В случае вопросов, пожеланий и претензий обращайтесь к нам по следующим координатам:\rСлужба доставки\r: 8 (495) 212 85 06 (многоканальный).\rЭлектронная почта\r: \rsale@testoptimalgroup.maler1988.tmweb.ru\rSkype\r: \rshipping.example.ru','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(4,'2018-07-21 16:22:16','main','s1|/about/howto/index.php',0,NULL,NULL,NULL,'/about/howto/index.php','Как купить','Процедура покупки товара в нашем Интернет-магазине очень проста и состоит из нескольких шагов.\r1. Оформление заказа\rПосле выбора товара нажмите кнопку \rВ корзину\r— товар добавится в вашу корзину.\rДалее, если вы закончили выбирать товар, нажмите кнопку \rваша корзина\r.\rНа странице \rваша корзина\rбудут перечислены все выбранные вами товары.\rВ поле \rКоличество\rвы пожете изменить количество товара для покупки. После изменения количества товара необходимо нажать кнопку \rПересчитать\rдля пересчета итоговой суммы заказа.\nВ колонке \rДействия\rнад каждым товаром можно произвести следующие действия: либо \rудалить\rтовар из корзины, либо \rотложить\rтовар на будущее.\rТакже можно ввести код скидки в соответствующее поле.\r2. Оформление и подтверждение заказа\rПосле ввода необходимой информации о доставке товара (ФИО получателя, адрес доставки, контактные данные, вариант доставки, способ оплаты и т.д) для оформления заказа вам нужно нажать кнопку \rОформить заказ\r.\rКопия заказа будет выслана на ваш e-mail, указанный при оформлении заказа.\rВнимание!\rНеправильно указанный номер телефона, неточный или неполный адрес могут привести к дополнительной задержке! Пожалуйста, внимательно проверяйте ваши персональные данные при регистрации и оформлении заказа.\rЧерез некоторое время (обычно в течение часа) после оформления покупки, с вами свяжется наш менеджер по контактным данным, указанным при оформлении заказа. С менеджером можно будет согласовать точное время и сроки доставки, а также уточнить детали.\rПримечание\r: Для постоянных клиентов на сайте магазина есть \rРегистрация\r. В своем кабинете вы можете просмотреть содержимое корзины, историю своих заказов, а также повторить или отказаться от заказа, подписаться на рассылку новостей магазина.\r3. Оплата и цены\rЦены, указанные на сайте, являются окончательными и не требуют доплат при стандартных условиях поставки. Все налоги включены в стоимость товара.\rВнимание!\rДля каждого отдельного заказа возможен только один способ оплаты на ваш выбор. Оплата заказа по частям различными способами невозможна.\rВозможные способы оплаты:\rНаличный расчет\r.\nОплата производится наличными курьеру при доставке или в магазине при самовывозе. Вместе с товаром передается товарный и кассовый чеки, а также гарантийный талон.\rОплата через Сбербанк\r.\nВы можете оплатить заказ в любом отделении Сбербанка. За услугу по переводу денег с вас возьмут от 3 до 7% от стоимости заказа, в зависимости от региона. Перечисление денег займет порядка 10 дней.','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(5,'2018-07-21 16:22:16','main','s1|/about/index.php',0,NULL,NULL,NULL,'/about/index.php','О магазине','Мы рады приветствовать вас на сайте нашей компании.\rНаша компания была основана в 1993 году, а наш интернет-магазин стал одним из первых магазинов, осуществляющих on-line продажу одежды в регионе. Компания специализируется на оптовой и розничной продаже одежды как для дома, так и для офиса.\rНа данный момент мы представляем собой крупную компанию, владеющую интернет&ndash;магазином и имеющую в своей сети единый call-центр, который регулирует всю деятельность магазина, отдел продаж, службу доставки, широкий штат квалифицированных сборщиков, собственный склад c постоянным наличием необходимого запаса товаров.\rЗа это время у нас сложились партнерские отношения с ведущими производителями, позволяющие предлагать высококачественную продукцию по конкурентоспособным ценам.\rМы можем гордиться тем, что у нас один из самых широких ассортиментов одежды в городе и области. \rНаши возможности\rБыстрая доставка\rНизкие цены\rШирокий ассортимент\rБонусы и подарки\rОтличное обслуживаение\rПрофессиональный менеджеры\rГарантия на все товары\rНадежные поставщики\rСезонные скидки\rПрограмма лояльности\rКарты постоянных клиентов\rМы всегда рады общению с нашими клиентами. Если у вас есть какие-либо пожелания, предложения, замечания, касающиеся работы нашего Интернет-магазина - пишите нам, и мы с благодарностью примем ваше мнение во внимание:\rЭлектронная почта\r: \rsale@testoptimalgroup.maler1988.tmweb.ru','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(6,'2018-07-21 16:22:16','main','s1|/about/guaranty/index.php',0,NULL,NULL,NULL,'/about/guaranty/index.php','Гарантия','Одной из важных составляющих работы нашего интернет-магазина является то, что продаваемые товары сертифицированы и обеспечены фирменной гарантией фирм-производителей. \rДля осуществления гарантийного обслуживания необходимы:\rправильно и без помарок и исправлений заполненный гарантийный талон, в котором должны быть указаны модель и серийный номер изделия, дата продажи и печать торгующей организации;\rдокумент, подтверждающий покупку (товарная накладная); \rполная комплектация товара.\rОбращаем также ваше внимание на то, что при получении и оплате заказа покупатель в присутствии курьера обязан проверить комплектацию и внешний вид изделия на предмет отсутствия физических дефектов (царапин, трещин, сколов и т.п.) и полноту комплектации. После отъезда курьера претензии по этим вопросам не принимаются.\rГарантийное обслуживание не производится, если:\rутерян или не заполнен гарантийный талон \rоборудование было поставлено на территорию РФ неофициально \rизделие имеет следы механического повреждения или вскрытия \rнарушены заводские пломбы \rбыли нарушены условия эксплуатации, транспортировки или хранения \rпроводился ремонт лицами, не являющимися сотрудниками авторизованного сервисного центра \rиспользовались неоригинальные комплектующие \rПодробное описание условий предоставления гарантии вы можете найти в документации к приобретенному товару и/или на сайте соответствующего производителя.','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(7,'2018-07-21 16:22:16','main','s1|/search/map/index.php',0,NULL,NULL,NULL,'/search/map/index.php','Карта сайта','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(8,'2018-07-21 16:22:16','main','s1|/search/index.php',0,NULL,NULL,NULL,'/search/index.php','Поиск','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(9,'2018-07-21 16:22:16','main','s1|/personal/order/payment/result.php',0,NULL,NULL,NULL,'/personal/order/payment/result.php','Результат оплаты','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(10,'2018-07-21 16:22:16','main','s1|/personal/order/payment/index.php',0,NULL,NULL,NULL,'/personal/order/payment/index.php','Оплата заказа','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(11,'2018-07-21 16:22:16','main','s1|/personal/order/make/index.php',0,NULL,NULL,NULL,'/personal/order/make/index.php','Заказы','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(12,'2018-07-21 16:22:16','main','s1|/personal/order/index.php',0,NULL,NULL,NULL,'/personal/order/index.php','Заказы','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(13,'2018-07-21 16:22:16','main','s1|/personal/cart/index.php',0,NULL,NULL,NULL,'/personal/cart/index.php','Корзина','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(14,'2018-07-21 16:22:16','main','s1|/personal/index.php',0,NULL,NULL,NULL,'/personal/index.php','Персональный раздел','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(15,'2018-07-21 16:22:16','main','s1|/news/index.php',0,NULL,NULL,NULL,'/news/index.php','Новости','','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(16,'2018-07-21 16:22:16','main','s1|/_index.php',0,NULL,NULL,NULL,'/_index.php','Интернет-магазин \"Одежда\"','Тренды сезона','','','','f6fc12bdc3479cd85d86ebe5fb9063aa',NULL,NULL),(17,'2018-07-21 16:22:20','iblock','1',0,NULL,NULL,NULL,'=ID=1&EXTERNAL_ID=1&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=news&IBLOCK_ID=1&IBLOCK_CODE=news&IBLOCK_EXTERNAL_ID=clothes_news&CODE=forum_of_producers_of_clothes_in_russia','Форум производителей одежды в России','С 20 по 23 февраля состоится \rФорум производителей одежды в России\r&ndash; важнейшее мероприятии отрасли в этом году.\r\n\rС 20 по 23 февраля этого года состоится \rФорум производителей одежды в России\r &ndash; важнейшее мероприятии отрасли в текущем году. В экспозиции принимают участие свыше 160 компаний из \rБеларуси, Австрии, Латвии, Литвы, России, Польши \rи\rУкраины\r. В составе форума состоится пять выставок:\"Московский Фэшн Салон\", \"Технологии в Одежде\", \"Офис Комфорт\", \"Повседневная одежда\" и \"Детская одежда\". Экспозиция будет строиться по принципу двух тематических секторов:\r одежда\rи \rматериалы для ее производства\r.\rВ секторе готовой одежды будут представлены:\rодежда для дома;\rодежда для детей и молодежи;\rаксессуары в одежде;\rодежда для спорта и отдыха;\rодежда для офиса.\rВ секторе материалов для производства одежды будут демонстрироваться новинки рынка одежной фурнитуры, материалов, тканей, элементов и аксессуаров для производства одежды.\rПомимо расширенной экспозиции пяти тематических выставок \"Экспофорум\" подготовил разнообразную деловую программу форума производителей Одежды. В рамках выставки состоятся семинары и мастер-классы. И поистине масштабным в этом году обещает стать республиканский конкурс форума \"\rНародное признание\r\". В этом году он выходит за рамки выставки и становится республиканским смотром образцов одежды.   \rФорум производителей Одежды\rпредоставляет специалистам возможность познакомиться с тенденциями моды, провести переговоры, получить практические предложения рынка, увидеть перспективы развития и новые конкурентные преимущества. Впервые для участников конкурса будет подготовлен маркетинговый отчет по результатам опроса посетителей выставок \rФорума производителей Одежды\r.\rПрием заявок на участие в конкурсе осуществляется до 12 января этого года.','','news','1',NULL,NULL,NULL),(18,'2018-07-21 16:22:20','iblock','2',0,NULL,NULL,NULL,'=ID=2&EXTERNAL_ID=8&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=news&IBLOCK_ID=1&IBLOCK_CODE=news&IBLOCK_EXTERNAL_ID=clothes_news&CODE=exhibition_salon_de_fashion','Международная выставка одежды Salon De Fashion','В следующем году состоится выставка одежды - Salon De Fashion, которая обещает быть еще более расширенной и интересной.\r\nВ следующем  году выставка Salon De Fashion обещает быть еще более расширенной и интересной. На выставке Salon De Fashion будут представлены все типы одежды для офиса и дома от платьев и шорт до VIP-аксессуаров, включая оборудование для производства и детской одежды. \rЗаявки на участие подали более чем 1 500 компаний со всего мира. Предполагается, что за время проведения выставки ее посетят более 300 000 тысяч человек. Экспозиция выставки разместится на общей площади 149 871 кв.м. В следующем году эта поистине грандиозная выставка будет проводиться уже в 14-й раз.','','news','1',NULL,NULL,NULL),(19,'2018-07-21 16:22:20','iblock','3',0,NULL,NULL,NULL,'=ID=3&EXTERNAL_ID=9&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=news&IBLOCK_ID=1&IBLOCK_CODE=news&IBLOCK_EXTERNAL_ID=clothes_news&CODE=waterproof_connection','Новое веяние в одежде - получено прочное водостойкое соединение','Получено новое прочное водостойкое клеевое соединение.Изобретение относится к области получения и применения клеящих составов, используемых в обработке тканей, кожи и других материалов. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный очень гибкий отвердитель. Который даст возможность делать новые виды аппликаций и соединения тканей и различных типов материалов.\r\n\rАвторы изобретения\r: Разиньков Егор Михайлович и Зайцева Анна Анатольевна\rПатент Российской Федерации RU2277566\rОписание изобретения\rИзобретение относится к области получения и применения клеящих составов, используемых в производстве одежды и аксессуаров. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный гибкий отвердитель. Прототипом клеевой композиции является клей, состоящий из карбамидоформальдегидной смолы, сополимера акрилонитрила с N-винилкапролактамом и отвердитель. В качестве отвердителя применяют хлористый аммоний либо акриловую кислоту. \rИзобретение решает задачу по получению прочного и водостойкого клеевого соединения. Это достигается тем, что клеевая композиция, включающая синтетическую смолу и отвердитель, согласно изобретению, дополнительно содержит модификатор, причем в качестве синтетической смолы клеевая композиция включает карбамидомеламиноформальдегидную смолу с отвердителем 2542, в качестве модификатора - карбамидоформальдегидную смолу, а в качестве отвердителя - 10%-ный раствор щавелевой кислоты при следующем соотношении компонентов, мас.ч.: \rКарбамидомеламиноформальдегидная смола\r64,5-79,2\r10%-ный Раствор щавелевой кислоты\r4,4-20,5\rОтвердитель для карбамидомеламиноформальдегидной \r0,6-2,0\rсмолы 2542\r13,0-15,8','','news','1',NULL,NULL,NULL),(20,'2018-07-21 16:22:25','iblock','S1',0,NULL,NULL,NULL,'=ID=1&EXTERNAL_ID=19&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=shoes','Обувь','Сложно представить себе элементы гардероба современного человека, которые выбирались бы более тщательно и основательно, чем обувь. Это больше, чем просто стильный аксессуар: ботинки, сапоги, туфли и другие модели выполняют очень важную функцию – они отвечают за комфорт, а иногда и за здоровье ног.',NULL,'catalog','2',NULL,NULL,NULL),(21,'2018-07-21 16:22:25','iblock','S2',0,NULL,NULL,NULL,'=ID=2&EXTERNAL_ID=26&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=pantolety','Пантолеты','Женские пантолеты – обувь, которая только с виду кажется непрактичной и простой. На самом деле, эти легкие и изящные шлепанцы универсальны: современные девушки все чаще выбирают их не только в качестве пляжной обуви, но и как удобный вариант на каждый день. Конечно, такая обувь в рамках офисного образа вряд ли станет удачным решением, однако в остальном у представительниц прекрасного пола – абсолютная свобода выбора.',NULL,'catalog','2',NULL,NULL,NULL),(22,'2018-07-21 16:22:25','iblock','S3',0,NULL,NULL,NULL,'=ID=3&EXTERNAL_ID=32&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=slippers','Тапочки','Яркие, удобные женские и мужские тапочки: для домашнего уюта и полноценного отдыха. Эта обувь помогает расслабиться после тяжелого и напряженного дня.\nТак приятно, придя домой, сменить тесные туфли или туфли на высоком каблуке на комфортные тапочки.',NULL,'catalog','2',NULL,NULL,NULL),(23,'2018-07-21 16:22:25','iblock','S4',0,NULL,NULL,NULL,'=ID=4&EXTERNAL_ID=29&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=shoess','Туфли','',NULL,'catalog','2',NULL,NULL,NULL),(24,'2018-07-21 16:22:25','iblock','S5',0,NULL,NULL,NULL,'=ID=5&EXTERNAL_ID=31&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=women-s-shoes','Туфли Женские','Считается, что женские туфли – это своеобразный «индикатор» наличия у девушки вкуса. Неправильно выбранная обувь может свести на нет все усилия по составлению эффектного и стильного образа. В то время как удачно выбранные женские туфли станут ярким акцентом даже самого скромного ансамбля.',NULL,'catalog','2',NULL,NULL,NULL),(25,'2018-07-21 16:22:25','iblock','S6',0,NULL,NULL,NULL,'=ID=6&EXTERNAL_ID=30&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=shoes-mens','Туфли Мужские','Мужская обувь, предлагаемая современными брендами представителям сильного пола, невероятно разнообразна. Касается это не только огромного количества всевозможных форм, но и различных стилевых отличий. Дело в том, что сегодня стало невероятно популярным смешение различных направлений и стилей, поэтому иногда даже в самых строгих ботинках можно найти легкие спортивные нотки.',NULL,'catalog','2',NULL,NULL,NULL),(26,'2018-07-21 16:22:25','iblock','S7',0,NULL,NULL,NULL,'=ID=7&EXTERNAL_ID=20&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=dresses','Платья','',NULL,'catalog','2',NULL,NULL,NULL),(27,'2018-07-21 1