XTERNAL_ID=clothes&CODE=women-s-belts','Ремни Женские','Женские ремни – это атрибут современной женщины, а также часть тщательно продуманного наряда. Придерживают ли они брюки на своем месте или эффектно подчеркивают талию, выполняют декоративную функцию или чисто практичную. Главное заключается в том, что для женщин ремень – это один из самых значимых аксессуаров.',NULL,'catalog','2',NULL,NULL,NULL),(34,'2018-07-21 16:22:25','iblock','S15',0,NULL,NULL,NULL,'=ID=15&EXTERNAL_ID=35&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=men-s-belts','Ремни Мужские','Стильные и качественные мужские ремни – обязательные аксессуары в гардеробе каждого современного представителя сильного пола, внимательно относящегося к своему внешнему виду. Правильно выбранный ремень поможет сделать образ завершенным, респектабельным и солидным.',NULL,'catalog','2',NULL,NULL,NULL),(35,'2018-07-21 16:22:25','iblock','4',0,NULL,NULL,NULL,'=ID=4&EXTERNAL_ID=177&IBLOCK_SECTION_ID=8&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=pants-striped-flight','Штаны Полосатый Рейс','Брюки-клеш идеально сидят и подчеркивают стройность фигуры. Модель имеет застежку на молнию. Изделие будет прекрасно гармонировать с любыми предметами гардероба. Длина изделия ок. 100см. Длина по внутреннему шву ок. 83см. Ширина внизу ок. 87см.\nДополнительное описание:\rФорма брючин:\r Широкие брючины\rВид застежки: \rМолния\rПо назначению: \rПовседневные\rСезон: \rдемисезон\rПол: \rЖенский\rСтиль: \rЖенственный стиль\rСтрана бренда:\r Россия\rСтрана производитель:\r Россия','','catalog','2',NULL,NULL,NULL),(36,'2018-07-21 16:22:25','iblock','5',0,NULL,NULL,NULL,'=ID=5&EXTERNAL_ID=207&IBLOCK_SECTION_ID=8&IBLOCK_TYPE_ID=catalog&IBLOCK_ID=2&IBLOCK_CODE=clothes&IBLOCK_EXTERNAL_ID=clothes&CODE=pants-life-in-abstraction','Штаны Жизнь в Абстракции','Свободные штаны с эффектом свободы, создают дополнительный разогревающий эффект во время ходьбы. Штаны &ndash;